import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import MainDash from "./components/MainDash/MainDash";
import RightSide from "./components/RightSide/RightSide"; // Updated import path
import EquipmentPage from "./components/EquipmentPage/EquipmentPage"; // Assuming EquipmentPage is also in a separate directory

function App() {
  return (
    <div className="App">
      <div className="AppGlass">
        <Router>
          <Routes>
            <Route path="/" exact element={<MainDash />} />
            <Route path="/equipment" exact element={<EquipmentPage />} />
          </Routes>
          <RightSide />
        </Router>
      </div>
    </div>
  );
}

export default App;
